    const response = await axios.get("https://api.covid19api.com/summary")
    return response.data.Countries


}

const ApiData = () => {

  const [data, setData] = useState([])

  useEffect(() => {
    fetchData().then(dataApi => {
      setData(dataApi)
    });


  }
  , [])


  return (
    <div>{data.map}</div>
  )
}

export default ApiData;
